import logo from './logo.svg';
import './App.css';
import $ from 'jquery';

function App() {
  var originalBG = $(".nav a").css("background-color");
  var lightColor = "#"
  var gradientSize = 10;

  $('.nav li:not(".active") a').mousemove(function(e) {
      let x = e.pageX - this.offsetLeft;
      let y = e.pageY - this.offsetTop;
      let xy = x + " " + y;
      let bgWebKit = "-webkit-gradient(radial, " + xy + ", 0, " + xy + ", 100, from(rgba(255,255,255,0.8)), to(rgba(255,255,255,0.0))), " + originalBG;
      let bgMoz = "-moz-radial-gradient(" + x + "px " + y + "px 45deg, circle, " + lightColor + " 0%, " + originalBG + " " + gradientSize + "px)";

      $(this)
          .css({background: bgWebKit})
          .css({background: bgMoz});
      }).mouseleave(function() {
      $(this).css({
          background: originalBG
      });
  });
  return (
    <div className="container c1">
      {/* <div className="glow"></div> */}
      <div id="div1">
        <h2>Let jQuery AJAX Change This Text</h2>
      </div>
      <div className="header">
        <h1 className="logo">JSX</h1>
        <ul>
          <li><a href="">abc</a></li>
          <li><a href="">def</a></li>
          <li><a href="">ghi</a></li>
          <li><a href="">jkl</a></li>
        </ul>
      </div>
    </div>
  );
}

export default App;
